import React from 'react';
import { Box, Grid, Typography, Container, Paper } from '@mui/material';
import { motion } from 'framer-motion';
import EnhancedTierCard from './EnhancedTierCard.tsx';
import { TrendingUp, Sparkles, Star, Shield, Users } from 'lucide-react';

const EnhancedTierGrid = ({ 
  tiers, 
  isInCart, 
  onAddToCart, 
  onRemoveFromCart,
  getTierColor,
  getTierIcon,
  getTierDescription,
  theme 
}) => {
  if (!tiers || tiers.length === 0) {
    return (
      <Box sx={{ textAlign: 'center', py: 6 }}>
        <Typography variant="h6" color="text.secondary">
          No tiers available for this sub-bundle.
        </Typography>
      </Box>
    );
  }

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.1,
        delayChildren: 0.2
      }
    }
  };

  const stats = [
    { label: "Active Users", value: "50,000+", icon: <Users size={24} /> },
    { label: "Success Rate", value: "99.9%", icon: <TrendingUp size={24} /> },
    { label: "Uptime", value: "99.99%", icon: <Shield size={24} /> }
  ];

  return (
    <Container maxWidth="xl">
      <motion.div
        variants={containerVariants}
        initial="hidden"
        animate="visible"
      >
        {/* Header Section */}
        <motion.div
          initial={{ opacity: 0, y: -20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
        >
          <Box sx={{ textAlign: 'center', mb: 6 }}>
            <Typography 
              variant="h3" 
              fontWeight="bold" 
              color="white" 
              sx={{ mb: 2 }}
            >
              Choose Your Tier
            </Typography>
            <Typography 
              variant="h6" 
              color="#bbb" 
              sx={{ mb: 4, maxWidth: 600, mx: 'auto' }}
            >
              Select the tier that best fits your security needs. Each tier offers 
              advanced AI-powered features designed to protect your assets effectively.
            </Typography>

            {/* Feature highlights */}
            <Box sx={{ 
              display: 'flex', 
              justifyContent: 'center', 
              gap: 4, 
              flexWrap: 'wrap',
              mb: 4 
            }}>
              <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                <Star size={20} color="#ff4081" />
                <Typography variant="body2" color="#ccc">
                  Premium Features
                </Typography>
              </Box>
              <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                <TrendingUp size={20} color="#4ade80" />
                <Typography variant="body2" color="#ccc">
                  Advanced Analytics
                </Typography>
              </Box>
              <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                <Sparkles size={20} color="#60a5fa" />
                <Typography variant="body2" color="#ccc">
                  AI-Powered Security
                </Typography>
              </Box>
            </Box>
          </Box>
        </motion.div>

        {/* Stats Section */}
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6, delay: 0.2 }}
        >
          <Box sx={{ 
            display: 'flex', 
            justifyContent: 'center', 
            gap: 6, 
            mb: 6,
            flexWrap: 'wrap'
          }}>
            {stats.map((stat, index) => (
              <motion.div
                key={index}
                initial={{ opacity: 0, scale: 0.8 }}
                animate={{ opacity: 1, scale: 1 }}
                transition={{ delay: 0.4 + index * 0.1 }}
              >
                <Paper 
                  elevation={4}
                  sx={{ 
                    p: 3, 
                    textAlign: 'center',
                    borderRadius: 3,
                    background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
                    color: 'white',
                    minWidth: 150,
                    border: '1px solid rgba(255,255,255,0.1)'
                  }}
                >
                  <Box sx={{ mb: 2 }}>
                    {stat.icon}
                  </Box>
                  <Typography variant="h4" fontWeight="bold" sx={{ mb: 1 }}>
                    {stat.value}
                  </Typography>
                  <Typography variant="body2" sx={{ opacity: 0.9 }}>
                    {stat.label}
                  </Typography>
                </Paper>
              </motion.div>
            ))}
          </Box>
        </motion.div>

        {/* Tiers Grid */}
        <Box sx={{ width: '100%' }}>
          <Grid container spacing={4} justifyContent="center">
            {tiers.map((tier, index) => (
              <EnhancedTierCard
                key={tier.id}
                tier={tier}
                index={index}
                isInCart={isInCart(tier.id)}
                onAddToCart={onAddToCart}
                onRemoveFromCart={onRemoveFromCart}
                getTierColor={getTierColor}
                getTierIcon={getTierIcon}
                getTierDescription={getTierDescription}
                theme={theme}
              />
            ))}
          </Grid>
        </Box>

        {/* Bottom CTA Section */}
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6, delay: 0.8 }}
        >
          <Paper 
            elevation={4}
            sx={{ 
              mt: 6, 
              p: 4, 
              textAlign: 'center',
              background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
              color: 'white',
              borderRadius: 4,
              border: '1px solid rgba(255,255,255,0.1)'
            }}
          >
            <Typography variant="h4" fontWeight="bold" sx={{ mb: 2 }}>
              Ready to Secure Your Assets?
            </Typography>
            <Typography variant="body1" sx={{ mb: 3, opacity: 0.9, maxWidth: 600, mx: 'auto' }}>
              Join thousands of organizations that trust our advanced security solutions. 
              Get started today and experience the future of AI-powered protection.
            </Typography>
            <Typography variant="body2" sx={{ opacity: 0.8 }}>
              ✨ 30-day free trial • 🔒 Enterprise-grade security • 🚀 Instant deployment • 📞 24/7 support
            </Typography>
          </Paper>
        </motion.div>
      </motion.div>
    </Container>
  );
};

export default EnhancedTierGrid;
